import React from 'react';
import Link from 'react-router-dom'


const Front = ()=>{
    
    return(
        <div id="front">
           <div>Social Media Management</div>
            <Link to="/signup">Sign Up</Link>
            <Link to="/Login">Login</Link>

        </div>
    )
}

export default Front;
